import React, { useEffect, useState } from 'react';
import Pagination from '@mui/material/Pagination';

function CustomListComp(props) {
    const [page, setPage] = useState(1);
    const [data, setData] = useState(props.data.slice(0, 8));

    useEffect(() => {
        setData(props.data.slice(0, 8));
    }, [props.data]);

    const handleChange = (event, value) => {
        setPage(value);
        setData(props.data.slice(8 * (value - 1), 8 * value));
    };

    console.log(data)

    return (
        <>
            <div className = 'row'>
                { data.slice(0 , 4).map((d, i) => (
                    <div className = 'col'>
                        <div key = { i } className = 'card'>
                            <div className = "card-body">
                                <h5 className = "card-title">Name: { d.name }</h5>
                                <p className = "card-text">Username: { d.userName }</p>
                                <p className="card-text">Username: { d.userName }</p>
                            </div>
                        </div>
                    </div>
                )) }
            </div>

            <div className = 'row'>
                { data.slice(4 , 8).map((d, i) => (
                    <div key = { i } className = 'col'  style = {{ borderStyle : 'solid', borderColor : "gray", borderWidth : "0.5px", margin : "5px" }}>{ d.name }</div>
                )) }
            </div>

            <Pagination
                count = { Math.ceil(props.data.length / 8) }
                page = { page }
                onChange = { handleChange }
                showFirstButton
                showLastButton
            />
        </>
    );
}

export default CustomListComp;
